                            name="normtest",
                            title="Test for Normality of residuals",
                            visible="(norm_test)",
                            clearWith=list(
                                "model_terms",
                                "dep",
                                "reml",
                                "re"),
                            columns=list(
                                list(
                                    `name`="name", 
                                    `title`="Test", 
                                    `type`="number"),
                                list(
                                    `name`="test", 
                                    `title`="Statistics", 
                                    `type`="number"),
                                list(
                                    `name`="p", 
                                    `type`="number", 
                                    `format`="zto,pvalue"))))
                        self$add(jmvcore::Image$new(
                            options=options,
                            name="qqplot",
                            title="Q-Q Plot",
                            visible="(qq_plot)",
                            width=500,
                            height=400,
                            renderFun=".qqPlot",
                            requiresData=TRUE,
                            clearWith=list(
                                "dep",
                                "model_terms",
                                "dep_scale")))
                        self$add(jmvcore::Image$new(
                            options=options,
                            name="normplot",
                            title="Residual histogram",
                            visible="(norm_plot)",
                            width=500,
                            height=400,
                            renderFun=".normPlot",
                            requiresData=TRUE,
                            clearWith=list(
                                "dep",
                                "dep_scale",
                                "model_terms")))
                        self$add(jmvcore::Image$new(
                            options=options,
                            name="residPlot",
                            title="Residual-Predicted Scatterplot",
                            visible="(resid_plot)",
                            width=500,
                            height=400,
                            renderFun=".residPlot",
                            requiresData=TRUE,
                            clearWith=list(
                                "dep",
                                "model_terms",
                                "dep_scale")))
                        self$add(jmvcore::Array$new(
                            options=options,
                            name="clusterBoxplot",
                            title="Residuals by cluster boxplot",
                            visible="(cluster_boxplot)",
                            clearWith=list(
                                "dep",
                                "dep_scale",
                                "model_terms"),
                            template=jmvcore::Image$new(
                                options=options,
                                title="$key",
                                renderFun=".clusterBoxplot",
                                width=500,
                                height=400)))
                        self$add(jmvcore::Array$new(
                            options=options,
                            name="clusterResPred",
                            title="Residual by cluster",
                            visible="(cluster_respred)",
                            clearWith=list(
                                "dep",
                                "dep_scale",
                                "model_terms"),
                            template=jmvcore::Image$new(
                                options=options,
                                title="$key",
                                renderFun=".clusterResPred",
                                width=500,
                                height=800)))
                        self$add(jmvcore::Array$new(
                            options=options,
                            name="randHist",
                            title="Random coefficients histogram",
                            visible="(rand_hist)",
                            clearWith=list(
                                "dep",
                                "dep_scale",
                                "model_terms"),
                            template=jmvcore::Image$new(
                                options=options,
                                title="$key",
                                renderFun=".randHist",
                                width=500,
                                height=400)))}))$new(options=options))
            self$add(jmvcore::Output$new(
                options=options,
                name="predicted",
                title="Predicted Vales",
                varTitle="`MIXED_PRED_${ dep }`",
                varDescription="Predicted values",
                clearWith=list(
                    "reml",
                    "dep",
                    "model_terms",
                    "re")))
            self$add(jmvcore::Output$new(
                options=options,
                name="residuals",
                title="Residuals Vales",
                varTitle="`MIXED_RES_${ dep }`",
                varDescription="Residuals values",
                clearWith=list(
                    "reml",
                    "dep",
                    "model_terms",
                    "re")))},
        .setModel=function(x) private$..model <- x))

